import Link from 'next/link';

const Header = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <a className="navbar-brand" href="/">
        <img src="/img/btc-logo.svg" width="110" height="50" className="d-inline-block align-top" alt="" />
      </a>
    </nav>
  );
};

export default Header;
